pub enum ContractError {
    Std(StdError),
    Unauthorized {
        },
    Claimed {
        },
    Expired {
        },
    ApprovalNotFound {
            spender: String,
        },
}

pub enum ExecuteMsg<T> {
    TransferNft {
            recipient: String,
            token_id: String,
        },
    SendNft {
            contract: String,
            token_id: String,
            msg: Binary,
        },
    Approve {
            spender: String,
            token_id: String,
            expires: Option<Expiration>,
        },
    Revoke {
            spender: String,
            token_id: String,
        },
    ApproveAll {
            operator: String,
            expires: Option<Expiration>,
        },
    RevokeAll {
            operator: String,
        },
    Mint(MintMsg<T>),
    Burn {
            token_id: String,
        },
}

pub enum QueryMsg {
    OwnerOf {
            token_id: String,
            include_expired: Option<bool>,
        },
    Approval {
            token_id: String,
            spender: String,
            include_expired: Option<bool>,
        },
    Approvals {
            token_id: String,
            include_expired: Option<bool>,
        },
    AllOperators {
            owner: String,
            include_expired: Option<bool>,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    NumTokens {
        },
    ContractInfo {
        },
    NftInfo {
            token_id: String,
        },
    AllNftInfo {
            token_id: String,
            include_expired: Option<bool>,
        },
    Tokens {
            owner: String,
            start_after: Option<String>,
            limit: Option<u32>,
        },
    AllTokens {
            start_after: Option<String>,
            limit: Option<u32>,
        },
    Minter {
        },
}
